import mysql.connector
from selenium import webdriver
from selenium.webdriver.chrome.options import Options

mydb = mysql.connector.connect(
    user="root",
    password="123456",
    host="localhost",
    database='baseteste'
)

mycursor = mydb.cursor()
options = Options()
options.add_argument('--headless')
options.add_argument('--disable-gpu')
driver = webdriver.Chrome("C:\Selenium\chromedriver", options=options)
driver.set_window_position(540, 0)
gpuArray = []
finalName = ''

class Gpu:
    def __init__(self, name, model, price, availability, vram, loja):
        self.name = name
        self.model = model
        self.price = price.replace('.','')
        self.availability = availability
        self.vram = vram
        self.loja = loja

    def printGPU(product):
        print('Produto: %s %s \nPre√ßo: R$%s \nDisponibilidade: %s \nVRAM: %s \nLoja: %s' % (
        product.name, product.model, product.price, product.availability, product.vram, product.loja))

def buscaProduto(linkProduto, name, model, vram, loja):
    driver.get(linkProduto)
    preco = driver.find_element_by_xpath('//*[@id="maincontent"]/div[2]/div/div[1]/div[2]/div[2]/span[2]/span').text
    if len(preco) < 10:
        preco = driver.find_element_by_xpath('//*[@id="maincontent"]/div[2]/div/div[1]/div[2]/div[2]/span[1]/span[2]/span').text
    preco = preco[10:len(preco) - 3]
    disponibilidade = driver.find_element_by_xpath(
        '//*[@id="maincontent"]/div[2]/div/div[1]/div[2]/div[1]/div[1]/span').text
    disponibilidade = disponibilidade[8:len(disponibilidade)]
    # finalName = name + model
    name = Gpu(name, model, preco, disponibilidade, vram, loja)
    gpuArray.append(name)

